const { container } = styles;

console.log('educationList', educationList);

const Education = () => (
  <div className={container}>
    <div className={heading}>
      <h2>Education</h2>
      <Separator />
    </div>
    {educationList.map((item: IEducationItem) => (
      <EducationItem item={item} />
    ))}
